import React from 'react';
import { SwiperData } from '../../service/swiperData';

const Swiper = (props) => {
        return (
            <>
            {SwiperData.map((slide, index) => {
                return <img src={slide.image} alt="book image" />;

            })}
            </>
        );
};

export default Swiper;
